import '.App.css';

import 'bootstrap/dist/css/bootstrap.min.css';
import { Container } from 'react-bootstrap';

import Catalog from './Components/BlockXSton/Catalog/Catalog';
import Posts from './Components/BlockXSton/Posts/Posts';
import Article from './Components/BlockXSton/Article/Article';
import Video from './Components/BlockXSton/Video/Video';
import Miss from './Components/BlockXSton/Miss/Miss';
import Editors from './Components/BlockXSton/Editors/Editors';
import Topic from './Components/BlockXSton/Topic/Topic';
import Footer from './Components/BlockXSton/Footer/Footer';

function App() {
  return (
    <Container fluid>
      <Catalog></Catalog>
      <Posts></Posts>
      <Article></Article>
      <Video></Video>
      <Miss></Miss>
      <Editors></Editors>
      <Topic></Topic>
      <Footer></Footer>
    </Container>
  );
}

export default App
